    //   },
    //   decomposition_one: {},
    //   decomposition_two: {}  
    // }
  }

  render() {
    return(
      <div>
        <Route exact path="/" component={FilePage}/>
        <Route exact path="/tool" component={DiffTool} />
      </div>
    )
  }
}

export default App;
